import {Anime} from "./styled.js";
import Logo from "../../assets/images/logo.png";
import { Link, InputSing, BtnSing, FormSing, SpanSing } from "react-router-dom";
import { LogoSign } from "../Header/styled.js";

export default function Sign(){

    return(
        <Anime>
            <LogoSign src={Logo} alt="Logo Driven"/>
            <FormSing>
                <InputSing type="email" name="" id="" placeholder="E-mail"/>
                <InputSing type="password" name="" id="" placeholder="Senha"/>
                <Link to="/subscriptions"><BtnSing disabled="">ENTRAR</BtnSing></Link>
            </FormSing>
            <Link to="/sign-up"><SpanSing>Não possuí uma conta? Cadastre-se</SpanSing></Link>
        </Anime>
    );
};
